Hey people, I have been getting so many questions on Face Shaving. It is absolutely alright to shave your face, it’s rather a choice and not a subject that is mandatory for everyone. But according to my experiences, I have been shaving since 2 years now I would highly recommend you do a patch test and see the results by yourself.

Pros of Shaving-
1. Exfoliation at its best, it exfoliates and removes the dead cells from your skin letting your skin breathe 
2. Makeup Base- It gives a flawless makeup base. It is good for both men and women out there who wants to feel their skin a little smoother than before.
3. Penetration of skincare products- It helps in deep penetration of your skin care products or say any medical products you are applying as the pores are so reachable.

Cons-
I don’t find any but yes as I said in the video if you shave the same area twice or thrice you may get red bumps.

Tip- Apply ice cubes and immediately put your toners once you are done if you face this issue.

